// App.js
import { useState } from 'react';
import firebase from './firebase';

function App() {
  const [books, setBooks] = useState([]);

  return (
    <div>
      <ul>
        {books.map((book) => {
          return (
            <li>
              <p>{book}</p>
            </li>
          )
        })}
      </ul>
    </div>
  )
}
